import React from 'react';
import * as S from './about-technologies.styles';
import {About_Technologies_Title_Container} from "./about-technologies.styles";
import Text from "../common/Text";
import Techno from "./Techno";


const technologies = [
    { "name": "React JS" ,
        "image": "/react.png",
    },{ "name": "Git" ,
        "image": "/git.png",
    },{ "name": "PHP" ,
        "image": "/php.png",
    },{ "name": "Node JS" ,
        "image": "/nodejs.png",
    },{ "name": "TypeScript" ,
        "image": "/typescript.png",
    },{ "name": "Docker" ,
        "image": "/docker.png",
    },{ "name": "Webgl" ,
        "image": "/webgl.png",
    },{ "name": "Vue" ,
        "image": "/vuejs.png",
    },{ "name": "Wordpress" ,
        "image": "/wordpress.png",
    },{ "name": "GraphQL" ,
        "image": "/graphql.png",
    }
]


const About_Technologies = () => {
    return (
        <S.About_Technologies_Wrapper>
            <S.About_Technologies_Title_Container>
                <Text
                    as ={'h2'}
                    fontWeight={600}
                    fontSize={"50px"}
                    color={"#333333"}
                    maxWidth={297}
                    textAlign={"center"}
                    lineHeight={"100%"}
                >
                    Design tools we work with
                </Text>
                <Text
                    as={"p"}
                    color={"rgba(0, 0, 0, 0.5);"}
                    fontSize={"16px"}
                    lineHeight={"140%"}
                    maxWidth={515}
                    textAlign={"center"}


                >
                    Each website we design is unique, meaning no templates and no recycled work. We want to make sure each client’s vision is represented in its truest form, so we start from the beginning. Our process varies from client to client and is broken up into curated phases. It goes something like this: discovery, web structure,  web design and web development. Don’t worry, we’ll explain all of this to you during the process.                </Text>

            </S.About_Technologies_Title_Container>
            <S.Techno_Container>
            {
                technologies.map(techno=>(
                    <Techno name={techno.name} image={techno.image} key={techno.name}/>
                ))

            }
            </S.Techno_Container>

        </S.About_Technologies_Wrapper>
    )
}

export default About_Technologies;
